import axios from 'axios'
import React, { useState, useEffect } from 'react'
import { render } from 'react-dom'
import { SafeAreaView, View, Text, Button, FlatList, TouchableOpacity, Dimensions } from 'react-native'


export function apim()
{


    const mockData = [
        { id: 1, todo: "Alışverişe çık"},
        { id: 2, todo: "Evi topla"},
        { id: 3, todo: "Spor yap"},
        ]



   render()
   {
       <View>
           <FlatList
    data={mockData}
    renderItem={({ item }) => <Text>{item.todo}</Text>}>
    </FlatList>
    </View>
    
   }





}
